import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import ReactHtmlParser from 'react-html-parser';
import Reciclators from '../reciclators/Reciclators';
import Costumers from '../costumers/Costumers';
import Purchases from '../purchases/Purchases';
import ControlPanel from '../control_panel/ControlPanel'
import DefaultPage from './DefaultPage';


import './desktop.css';

class Container extends Component {
	// constructor(props, context) { 
 //    	super(props, context); 
 //    	this.props.componente = "Login"; 	   
	// } 		
  	render() {
  		var componentList = {
  			DefaultPage  : DefaultPage,
			Reciclators  : Reciclators,
			Costumers    : Costumers,
			Purchases    : Purchases,
			ControlPanel : ControlPanel,	    
		}  

		var componente = String(this.props.componente);
		if(componente=='' || componente==undefined){
			componente = "DefaultPage";
		}
		console.log(componentList[componente]);
  		var ChildComponent = componentList['Reciclators'];		
  	  	return (  	  		  
  	  		<div>
  	  			<ChildComponent />
  	  		</div>     
	    );
  	}
}

export default Container
